import React from 'react';
import { Outlet } from 'react-router-dom';
import NavBar from '../NavBar/index';
import Header from '../Header';

function LayoutComum() {
  return (
    <>
      <Header/>
      <Outlet />
    </>
  );
}

export default LayoutComum;
